import {cloneElement, React, useState} from 'react';
import * as style from "../../css/focusedList";

export default function Focused(props) {
  const [focused, setFocused] = useState([props.focused])

  const test = () => {
    props.focused[0].forEach(e => {
      console.log(e.innerHTML)
    }) 
  }

  const renderFocusedList = () => {
    return focused[0].map((i, item) => {
      <div dangerouslySetInnerHTML={{__html: item.innerHTML}}></div>
    })
  }
  return (
    <div onClick={() => test()} style={style.container}>
      {renderFocusedList()}
    </div>
  )
}
